import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={props.expenses[0].title}
        amount={props.expenses[0].amount}
        date={props.expenses[0].date}
      />
      <ExpenseItem
        title={propsexpenses[1].title}
        amount={propsexpenses[1].amount}
        date={propsexpenses[1].date}
      />
      <ExpenseItem
        title={propsexpenses[2].title}
        amount={propsexpenses[2].amount}
        date={propsexpenses[2].date}
      />
      <ExpenseItem
        title={propsexpenses[3].title}
        amount={propsexpenses[3].amount}
        date={propsexpenses[3].date}
      />
    </div>
  );
}

export default Expenses;
